import React from 'react';
import TarjetaPresentacion from './components/TarjetaPresentacion';

const App = () => {
  return (
    <div>
      <TarjetaPresentacion 
        nombre="Juan" 
        apellido="Pérez" 
        profesion="Desarrollador Web" 
        descripcion="Apasionado por la tecnología y el desarrollo de aplicaciones web." 
      />
    </div>
  );
};

export default App;
